import{_ as e,c as a,o,V as r}from"./chunks/framework.sev-WgE4.js";const c="/assets/memes.yG-pxtba.jpg",d="/assets/yinpa.-hzLXjSt.jpg",k=JSON.parse('{"title":"葱喵Bot帮助","description":"","frontmatter":{},"headers":[],"relativePath":"BotHelp.md","filePath":"BotHelp.md"}'),t={name:"BotHelp.md"},i=r('<h1 id="葱喵bot帮助" tabindex="-1">葱喵Bot帮助 <a class="header-anchor" href="#葱喵bot帮助" aria-label="Permalink to &quot;葱喵Bot帮助&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>使用本bot即默认您同意<a href="/terms.html">用户协议</a></p></div><h2 id="音游功能" tabindex="-1">音游功能 <a class="header-anchor" href="#音游功能" aria-label="Permalink to &quot;音游功能&quot;">​</a></h2><p>本BOT音游相关由第三方Bot服务提供<br></p><h3 id="chieribot帮助" tabindex="-1">ChieriBot帮助 <a class="header-anchor" href="#chieribot帮助" aria-label="Permalink to &quot;ChieriBot帮助&quot;">​</a></h3><p>提供了Arcaea，MaiMai，OSU！，等游戏的查询<br><a href="https://chieri.docs.chinosk6.cn" target="_blank" rel="noreferrer">ChieriBot帮助文档</a><br></p><h3 id="unibot帮助" tabindex="-1">UniBot帮助 <a class="header-anchor" href="#unibot帮助" aria-label="Permalink to &quot;UniBot帮助&quot;">​</a></h3><p>提供了ProjectSekai/世界计划的游戏查询</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Unibot内猜曲，猜卡面等功能需要联系bot主单独开放</p></div><p><a href="https://docs.unipjsk.com" target="_blank" rel="noreferrer">Unibot使用帮助</a></p><h3 id="maimaidx" tabindex="-1">MaiMaiDX <a class="header-anchor" href="#maimaidx" aria-label="Permalink to &quot;MaiMaiDX&quot;">​</a></h3><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>不会上传maimai分数？没关系，请看我们的<a href="/xdiamiam.html">上传教程</a></p></div><p>请在群内发送<code>帮助MaiMaiDX</code>获取帮助图片<br></p><h2 id="实用功能" tabindex="-1">实用功能 <a class="header-anchor" href="#实用功能" aria-label="Permalink to &quot;实用功能&quot;">​</a></h2><h3 id="天气" tabindex="-1">天气 <a class="header-anchor" href="#天气" aria-label="Permalink to &quot;天气&quot;">​</a></h3><p>发送<code>天气 城市</code>或<code>城市 天气</code>获取天气（可能出图较慢，请耐心等待）</p><h3 id="签到" tabindex="-1">签到 <a class="header-anchor" href="#签到" aria-label="Permalink to &quot;签到&quot;">​</a></h3><p><code>签到</code> 进行签到<br></p><h3 id="词云" tabindex="-1">词云 <a class="header-anchor" href="#词云" aria-label="Permalink to &quot;词云&quot;">​</a></h3><p><code>今日词云</code> 获取今日词云<br><code>昨日词云</code> 获取昨日词云<br><code>本周词云</code> 获取本周词云<br><code>上周词云</code> 获取上周词云<br><code>本月词云</code> 获取本月词云<br><code>上月词云</code> 获取上月词云<br></p><h3 id="状态" tabindex="-1">状态 <a class="header-anchor" href="#状态" aria-label="Permalink to &quot;状态&quot;">​</a></h3><p><code>状态</code> 查看机器人运行状态</p><h3 id="色图" tabindex="-1">色图 <a class="header-anchor" href="#色图" aria-label="Permalink to &quot;色图&quot;">​</a></h3><p><code>色图 [0-10张] [r18] [tag]</code> 发送色图<br> 上面[]中均为可选参数，tag可多选，多tag请添加空格分割<br></p><div class="danger custom-block"><p class="custom-block-title">DANGER</p><p>r18暂不提供使用</p></div><h3 id="偷窥" tabindex="-1">偷窥 <a class="header-anchor" href="#偷窥" aria-label="Permalink to &quot;偷窥&quot;">​</a></h3><p><code>cb peek</code> 偷窥bot主的屏幕</p><h3 id="反馈" tabindex="-1">反馈 <a class="header-anchor" href="#反馈" aria-label="Permalink to &quot;反馈&quot;">​</a></h3><p><code>.send+反馈内容</code>向维护组成员发送反馈</p><h3 id="steam订阅" tabindex="-1">steam订阅 <a class="header-anchor" href="#steam订阅" aria-label="Permalink to &quot;steam订阅&quot;">​</a></h3><p><code>steam绑定</code> [STEAM ID] 绑定steam（必须为steam17位id）<br><code>steam解绑</code> [STEAM ID] 解绑steam（同上）<br><code>steam列表</code> 呼出本群订阅列表<br></p><h2 id="娱乐功能" tabindex="-1">娱乐功能 <a class="header-anchor" href="#娱乐功能" aria-label="Permalink to &quot;娱乐功能&quot;">​</a></h2><h3 id="今日运势" tabindex="-1">今日运势 <a class="header-anchor" href="#今日运势" aria-label="Permalink to &quot;今日运势&quot;">​</a></h3><p><code>今日运势</code> 查看今天的运势</p><h3 id="棋类游戏" tabindex="-1">棋类游戏 <a class="header-anchor" href="#棋类游戏" aria-label="Permalink to &quot;棋类游戏&quot;">​</a></h3><p><code>@机器人+五子棋</code> 开启五子棋游戏<br><code>@机器人+围棋</code> 开启围棋游戏<br><code>@机器人+黑白棋</code> 开启黑白棋游戏<br><code>落子 字母+数字</code> 下棋（本指令不需要加命令前缀）<br><code>@机器人+boardgame [options]</code> 执行棋类游戏命令<br> 可用选项：<br> · <code>-r RULE</code>,<code>--rule RULE</code> 规则名<br> · <code>-e</code>,<code>--end</code>,<code>--stop</code> 停止下棋<br> ·<code>-v</code>,<code>--view</code>,<code>--show</code> 显示棋盘<br> ·<code>--repent</code> 悔棋<br> ·<code>--skip</code> 跳过回合<br> ·<code>--reload</code> 重启因为超时/被指令关闭而关闭的棋局<br> ·<code>--white</code> 白方起手，即后手<br> ·<code>POSITION</code> 位置<br></p><h3 id="猜单词" tabindex="-1">猜单词 <a class="header-anchor" href="#猜单词" aria-label="Permalink to &quot;猜单词&quot;">​</a></h3><p><code>wordle [options]</code> 开启游戏 可用选项：<br><code>-l</code>,<code>--length</code> 指定单词长度，默认为5（在选项后跟数字）<br><code>-d</code>,<code>--dic</code> 指定词典，默认为CET4<br> 可选词典：<br> GRE,考研,GMAT,专四,TOFEL,SAT,专八,IELTS,CET4,CET6<br><s>BOT主：我是一个也看不懂</s><br><code>--hint</code> 获取提示<br><code>--stop</code> 停止游戏<br></p><h3 id="猜成语" tabindex="-1">猜成语 <a class="header-anchor" href="#猜成语" aria-label="Permalink to &quot;猜成语&quot;">​</a></h3><p><code>猜成语 [options]</code>开启游戏<br> 可用选项:<br><code>--hint</code> 获取提示<br><code>--stop</code> 停止游戏<br><code>--strict</code> 开启严格模式，即猜测短语必须为成语<br></p><h3 id="头像表情包" tabindex="-1">头像表情包 <a class="header-anchor" href="#头像表情包" aria-label="Permalink to &quot;头像表情包&quot;">​</a></h3><p>触发指令：指令+@某人/qq号/自己/【图片】 支持的指令：</p><div align="center"><img src="'+c+'" width="50%"></div><h3 id="yinpa" tabindex="-1">yinpa <a class="header-anchor" href="#yinpa" aria-label="Permalink to &quot;yinpa&quot;">​</a></h3><div align="center"><img src="'+d+'" width="50%"></div><h3 id="娶群友" tabindex="-1">娶群友 <a class="header-anchor" href="#娶群友" aria-label="Permalink to &quot;娶群友&quot;">​</a></h3><ul><li><code>娶群友</code> 纯爱，一天刷新一次，双向奔赴<br></li><li><code>娶群友@name</code> 有概率娶到艾特的人<br></li><li><code>分手</code>，<code>离婚</code> 字面意思<br></li><li><code>本群cp</code> 查看当前群内cp<br></li><li><code>群友卡池</code> 查看当前群可以娶到的群友列表<br></li><li><code>透群友</code> 字面意思，每次抽到的结果都不一样<br></li><li><code>涩涩记录</code> 查看当前群群友今日透群友次数和被透次数，记录跨群<br><s>群友背地里玩的挺花</s></li></ul>',47),l=[i];function h(s,n,b,p,m,u){return o(),a("div",null,l)}const f=e(t,[["render",h]]);export{k as __pageData,f as default};
